import React from "react";

function Emoji(props){
    return (
      <dl className="dictionary">
        <div className="term">
        <Name_Symbol 
            sym = {props.emoji}
            name = {props.name}
        />
        <Definition 
            def = {props.maining}
        />
        </div>
      </dl>
  );

}

export default Emoji;
